import React from 'react';
import '../myportfolio/App.css'

const Navigation = () => {
	return (
		<div>
			<nav className='mv3'>
				<ul className='mv6 margv'>
					<li className='mv3'><a href=''>About</a></li>
					<li><a href=''>Projects</a></li>
					<li><a href=''>Contact</a></li>
				</ul>
			</nav>
		</div>
	);
}

export default Navigation;
